S = ""
K = 98


n  = len(S)
dp = [[[0 for _ in range(2)] for _ in range(n)] for _ in range(K)]

for i in range(K):
  for j in range(n):
    dp[i][j][0] = dp[i][j][1] = 0;

for i in range(n):
  dp[0][i][0] = dp[0][i][1] = 1

for l in range(1,K):
  print(l)
  num = [[0 for _ in range(2)] for _ in range(26)]
  for i in range(l,n):
    dp[l][i][0] = 0;
    dp[l][i][1] = 0;
    num[ord(S[i - 1]) - 97][0] += dp[l - 1][i - 1][0];
    num[ord(S[i - 1]) - 97][1] += dp[l - 1][i - 1][1];
    for j in range(0, ord(S[i]) - 97):
      dp[l][i][1] += num[j][0]
    for j in range(ord(S[i]) - 97 + 1, 26):
      dp[l][i][0] += num[j][1]

sumx = 0
for i in range(K - 1, n):
  sumx += dp[K - 1][i][0];
  sumx += dp[K - 1][i][1];
print(sumx % 1000)


